import React, { useState, useEffect } from "react";
import basestyle from "../../css/Base.module.css";
import loginstyle from "./Login.module.css";
import { GoogleOAuthProvider, GoogleLogin } from '@react-oauth/google';
import axios from "axios";
import { useNavigate, NavLink } from "react-router-dom";
import { useAuth } from '../AuthContext/AuthContext';

const Login = () => {
  const navigate = useNavigate();
  const [formErrors, setFormErrors] = useState({});
  const [isSubmit, setIsSubmit] = useState(false);
  const [user, setUserDetails] = useState({
    email: "",
    password: "",
  });

  const { login } = useAuth();

  const changeHandler = (e) => {
    const { name, value } = e.target;
    setUserDetails({
      ...user,
      [name]: value,
    });
  };

  const validateForm = (values) => {
    const error = {};
    const regex = /^[^\s@]+@[^\s@]+\.[^\s@]{2,}$/i;
    if (!values.email) {
      error.email = "Email is required";
    } else if (!regex.test(values.email)) {
      error.email = "Please enter a valid email address";
    }
    if (!values.password) {
      error.password = "Password is required";
    }
    return error;
  };

  const loginHandler = (e) => {
    e.preventDefault();
    setFormErrors(validateForm(user));
    setIsSubmit(true);
  };

  useEffect(() => {
    if (Object.keys(formErrors).length === 0 && isSubmit) {
      login(user.email, user.password).then(() => {
        navigate('/welcome', { replace: true });
      }).catch((error) => {
        alert('Login failed');
      }).finally(() => {
        setIsSubmit(false);
      });
    }
  }, [formErrors, isSubmit, login, navigate, user]);

  const handleGoogleSuccess = (response) => {
    console.log("Google login successful, response:", response);
    axios.get(`http://ec2-3-107-93-162.ap-southeast-2.compute.amazonaws.com:5000/login/google?code=${response.code}`, {
      headers: {
        'Content-Type': 'application/json',
      },
    }).then((res) => {
      console.log("Response from backend:", res.data); // Debugging line
      setUserState(res.data.user);
      localStorage.setItem("token", res.data.token); // Store token in local storage
      navigate("/welcome", { replace: true });
    }).catch((error) => {
      console.error("Google login error:", error); // Debugging line
      alert("Error: " + error.message);
    });
  };

  const handleGoogleFailure = (error) => {
    console.error("Google login failed:", error);
    alert("Google login failed");
  };

  return (
    <GoogleOAuthProvider clientId="46755883129-6s7civ58e0e28egeb9vecbt7c6b0mr7b.apps.googleusercontent.com">
      <div className={loginstyle.login}>
        <form onSubmit={loginHandler}>
          <button className={loginstyle["close-button"]}>×</button>
          <h1>Login</h1>
          <div className={loginstyle.inputContainer}>
            <label>Email</label>
            <input
              type="email"
              name="email"
              placeholder="Enter Email"
              onChange={changeHandler}
              value={user.email}
              className={loginstyle.inputField}
            />
            <p className={basestyle.error}>{formErrors.email}</p>
          </div>
          <div className={loginstyle.inputContainer}>
            <label>Password</label>
            <input
              type="password"
              name="password"
              placeholder="Enter Password"
              onChange={changeHandler}
              value={user.password}
              className={loginstyle.inputField}
            />
            <p className={basestyle.error}>{formErrors.password}</p>
          </div>
          <div className={loginstyle["remember-me"]}>
            <input type="checkbox" id="rememberMe" name="rememberMe" />
            <label htmlFor="rememberMe">Remember me</label>
          </div>
          <button className={`${basestyle.button_common} ${loginstyle.loginButton}`} type="submit">
            Login
          </button>
          <NavLink to="/forgot-password" className={loginstyle.forgotPassword}>
            Forgot password?
          </NavLink>

          <div className={loginstyle.newUser}>
            <span>New user?</span>
            <NavLink to="/signup" className={loginstyle.signupButton}>
              Signup Now
            </NavLink>
          </div>
          <div className={loginstyle.oauth}>
            <GoogleLogin
              onSuccess={handleGoogleSuccess}
              onError={handleGoogleFailure}
            />
          </div>
        </form>
      </div>
    </GoogleOAuthProvider>
  );
};

export default Login;
